import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";
import Img from "../ asset/fofl.png";

const Logo = styled("img")(({ theme }) => ({
  position: "relative",
  width: "100px",

  [theme.breakpoints.down("sm")]: {
    width: "100px",
    position: "relative",
  },
}));

const Con = styled("div")((theme) => ({
  color: "red",
  fontSize: "40px",

  [theme.breakpoints.down("sm")]: {},
}));

function Home() {
  return (
    <>
      <Box
        sx={{
          height: "179px",
          maxWidth: "100%",
        }}
      >
        <Container>
          <Grid
            container
            xs={{
              position: "relative",
              top: "800px",
            }}
          >
            <Grid item xs={5} sm={6}>
              <Logo src={Img}></Logo>
            </Grid>
            <Grid item xs={4} sm={4}></Grid>
            <Grid item xs={3} sm={2}>
              condut us
            </Grid>
          </Grid>
          <Grid container>
            <Grid item></Grid>
          </Grid>
        </Container>
      </Box>
    </>
  );
}

export default Home;
